    this.context = context;

    this.speed = 16;

    this.control()
	}

  playerRight() {
    this.moveRight(); 
  }

  playerLeft() {
    this.moveLeft(); 
  }

  playerUp() {
    this.moveUp(); 
  }

  playerDown() {
    this.moveDown(); 
  }

  control() {

  }




};
